const Body = () => {
  return (
    <section className="body">
      <div className="top">
        <div className="left">
          <input
            type="text"
            className="search form-control"
            placeholder="Search for an article"
          />
        </div>
        {/* /.left */}
        <div className="middle">
          <ul className="body-nav list-unstyled d-flex">
            <li className="body-nav-item">All</li>
            <li className="body-nav-item">Networking</li>
            <li className="body-nav-item">Business</li>
            <li className="body-nav-item">Men&amp;Mice</li>
            <li className="body-nav-item">Events</li>
            <li className="body-nav-item">Courses</li>
          </ul>
          {/* /.body-nav */}
        </div>
        {/* /.moddle */}
        <div className="right">
          <div className="sort">
            <span>Sort by: </span>
            <button className="sort-button">Newest</button>
          </div>
        </div>
        {/* /.right */}
      </div>
      {/* /.top */}
      <div className="bottom">
        <div className="left"></div>
        {/* /.left */}
        <div className="middle"></div>
        {/* /.moddle */}
        <div className="right"></div>
        {/* /.right */}
      </div>
      {/* /.bottom */}
      <style jsx>{`
        textarea:hover,
        input:hover,
        textarea:active,
        input:active,
        textarea:focus,
        input:focus,
        button:focus,
        button:active,
        button:hover,
        label:focus,
        .btn:active,
        .btn.active {
          outline: 0px !important;
          -webkit-appearance: none;
          box-shadow: none !important;
        }
        .body .top .left .search {
          background: url(/img/search.svg) no-repeat transparent;
          background-position: left center;
          border: none;
          outline: none;
          padding-left: 35px;
        }
        .body .top .left .search:focus {
          border: none;
          outline: none;
        }
      `}</style>
    </section>
  );
};

export default Body;
